import {
  FlatList,
  ScrollView,
  Text,
  View,
  Image,
  TouchableHighlight,
} from "react-native";
import React from "react";
import styles from "./Styles";

const BookList = () => {
  return (
    <View style={styles.container}>
      <TouchableHighlight underlayColor="rgba(73,182,77,0.9)">
        <TouchableHighlight underlayColor="rgba(73,182,77,0.9)">
          <View style={styles.card}>
            <Image
              style={styles.photo}
              source={{
                uri: "https://d1csarkz8obe9u.cloudfront.net/posterpreviews/action-thriller-book-cover-design-template-3675ae3e3ac7ee095fc793ab61b812cc_screen.jpg?ts=1637008457",
              }}
            />
            <Text style={styles.title}>The King of Drugs</Text>
            <Text style={styles.category}>Category</Text>
          </View>
        </TouchableHighlight>
      </TouchableHighlight>
    </View>
  );
};

export default BookList;
